import React from 'react';
import styled from 'styled-components';
import { BlotterText } from './BlotterText';

const HeroContainer = styled.section`
  height: 100vh;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  position: relative;
  overflow: hidden;
`;

const BlotterContainer = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 100%;
  padding: 0 2rem;
`;

export const Hero: React.FC = () => {
  return (
    <HeroContainer>
      <BlotterContainer>
        <BlotterText 
          text="SQUANCH" 
          size={window.innerWidth < 768 ? 120 : 200}
          fill="#ffffff"
        />
      </BlotterContainer>
    </HeroContainer>
  );
};
